import './HomeContent.css'

import Grid from '../Grid/Grid';
// import GridChild from '../Grid/GridChild';

class HomeContent extends Component {
    render(){
        return (
                <main id="layout-container">
                    <div id="content">
                        <Grid>
                            <h2>asd</h2>
                        </Grid>
                    </div>
                </main>
        )
    }
}

export default HomeContent;
